export default function SearchResultsItem({ noticias }){
    return(
        <div>  
            {
                noticias.length && noticias.map((values, index) => {
                    return(
                    <ul>
                        <li>{values.author ? values.author : "Anonimo"}</li>
                    </ul>
                    )
                })
            }               
        </div>
    );
}
